(170, 169, NULL, '2013-04-20 02:40:26', NULL, 'En Pittier 1936 como Anomobryum ceramiocarpum (Müll. Hal.) Broth. # Recientes estudios de las relaciones filogenéticas en Bryaceae basadas en evidencias del ADN del cloroplasto (Cox & Hedderson 2003 y Pedersen et al. 2003) muestran que Bryum y Brachymenium no son un grupo monofilético y que Anomobryum, Plagyobryum y Rhodobryum se muestran en un mismo clado.\r\nEstas conclusiones fueron anticipadas por Ochi (1972, 1992) y otros taxónomos mediante estudios morfológicos detallados.\r\nOchi 1980 propone tres subgéneros (Bryum, Rhodobryum y Anomobryum) dentro del género Bryum. \r\nAunque varios autores aceptan a dichos subgéneros como géneros, aquí se utiliza la clasificación propuesta por Ochi 1980 y 1981 donde se tratan a Rhodobryum y Anomobryum como subgéneros del género Bryum, aceptando en este caso en nombre de !Bryum conicum Hornsch. en vez de Anomobryum conicum (Hornsch.) Broth. (Comentario ingresado marzo 2013)\r\n\r\nCox, C.J. and T.A.J. Hedderson. 2003. Phylogenetic relationships within the moss family\r\nBryaceae based on chloroplast DNA evidence. J. Bryol. 25: 31-40.\r\nOchi, H. 1980. A revision of the neotropical Bryoïdeae, Musci (First part). J. Fac. Educ. Tottori Univ., Nat. Sci. 29: 49154.\r\nOchi, H. 1981. A revision of the neotropical Bryoïdeae, Musci (second part). J. Fac. Educ. Tottori Univ., Nat. Sci. 30: 2155.\r\nPedersen, N., C. J. Cox & L. Hedenäs. 2003. Phylogeny of the moss family Bryaceae inferred from chloroplast sequences and morphology. Syst. Bot. 28: 471482\r\n', 2, 'Bryum conicum', 1, 6, 'Hornsch.', 0, NULL, 'Venezuela, Ecuador,  Brasil, Bolivia, Colombia, Costa Rica, México, Hawái', NULL, 'Am 4, Am 5.', 'Ussher M. S. (MERC) ', NULL, 'Bryum conicum Hornsch. Nombre aceptado por Ochi 1980. J. Fac. Educ. Tottori Univ. Nat. Sci. 29: 100. Part I.', NULL, 3),
